import { useState } from 'react';
import './App.css';
import Login from './components/Login';
import Register from './components/Register'
function App() {
  let [isToggle, setIsToggle] = useState(true)

  return (
    <div className='app'>
      <div className='mainContent'>


        {isToggle? <Register/>:<Login />}


      </div>
    </div>
  );
}

export default App;
